module.exports = {"setting":{"title":"更新日志","order":99,"sidebar":"doc"},"catalogs":[],"contents":"<h2 id='header-v0.8.0'>v0.8.0</h2><h5 id='header-Core'>Core</h5><ol>\n<li><code>Add</code> <code>TableColumn</code>支持<code>className</code>属性，用于给当前列所有单元格添加<code>class</code>来控制列样式 <a href=\"https://github.com/ksc-fe/kpc/issues/164\">#164</a></li>\n<li><code>Add</code> <code>Table</code>支持导出表格内容成<code>csv</code>格式并下载，而且支持自定义表格数据进行全量导出 <a href=\"https://github.com/ksc-fe/kpc/issues/171\">#171</a></li>\n<li><code>Add</code> 新增<code>Icon</code>组件，统一字体图标使用方式 <a href=\"https://github.com/ksc-fe/kpc/issues/169\">#169</a></li>\n<li><code>Add</code> <code>Upload</code>支持上传文件夹 <a href=\"https://caniuse.com/#feat=input-file-directory\">caniuse</a> <a href=\"https://github.com/ksc-fe/kpc/issues/168\">#168</a></li>\n<li><code>Add</code> <code>Tree</code>支持选中节点功能，通过<code>selectedKeys</code>控制，默认选中会高亮 <a href=\"https://github.com/ksc-fe/kpc/issues/167\">#167</a></li>\n<li><code>Add</code> <code>Pagination</code>支持简洁样式 <a href=\"https://github.com/ksc-fe/kpc/issues/177\">#177</a></li>\n<li><code>Fix</code> 修复babel@7不支持commonjs和es6 module混用，导致组件库入口文件<code>index.js</code>调用全量安装方法报错的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/172\">#172</a></li>\n<li><code>Fix</code> 修复<code>Input</code>在自动宽度<code>autoWidth</code>情况下，去除<code>autoWidth</code>不能还原<code>Input</code>宽度的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/178\">#178</a></li>\n<li><code>Fix</code> 修复<code>Select</code>内联模式<code>inline</code>情况下，存在背景色的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/179\">#179</a></li>\n<li><code>Change</code> <code>Breadcrumb</code>废弃掉<code>separator</code>属性，改用<code>separator</code>扩展点代替，分隔符定制更灵活 <a href=\"https://github.com/ksc-fe/kpc/issues/165\">#165</a></li>\n<li><code>Change</code> 将<code>peerDependencies</code>依赖改为直接依赖<code>dependencies</code>，方便版本更新管理 <a href=\"https://github.com/ksc-fe/kpc/issues/174\">#174</a></li>\n</ol>\n<h5 id='header-React'>React</h5><ol>\n<li><code>Fix</code> <code>Select</code>修复不能展示已选<code>Option</code>文案的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/170\">#170</a></li>\n</ol>\n<h5 id='header-Vue'>Vue</h5><ol>\n<li><code>Fix</code> <code>FormItem</code>在某些情况下不能进行表单验证的问题</li>\n</ol>\n<h2 id='header-v0.7.9'>v0.7.9</h2><ol>\n<li><code>Refactor</code> 升级babel@7进行构建，自动引入实例方法polyfill，提高兼容性 <a href=\"https://github.com/ksc-fe/kpc/issues/157\">#157</a></li>\n<li><code>Add</code> 新增React开始文档</li>\n<li><code>Add</code> Tree在过滤时，默认展开匹配的节点 <a href=\"https://github.com/ksc-fe/kpc/issues/156\">#156</a></li>\n<li><code>Fix</code> 修复Collapse默认主题下没有折叠展开动画的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/153\">#153</a></li>\n<li><code>Fix</code> 修复Collapse在没有内容导致高度为0时，动画不执行结束回调的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/150\">#150</a> <a href=\"https://github.com/ksc-fe/kpc/issues/162\">#162</a></li>\n<li><code>Fix</code> 修复IE下多处兼容性问题，目前支持IE10及以上 <a href=\"https://github.com/ksc-fe/kpc/issues/155\">#155</a></li>\n</ol>\n<h2 id='header-v0.7.6'>v0.7.6</h2><ol>\n<li><code>Add</code> <code>Collapse</code>使用<code>display: none</code>代替删除折叠起来的元素 <a href=\"https://github.com/ksc-fe/kpc/issues/149\">#149</a></li>\n<li><code>Fix</code> <code>Datepicker</code> <code>disabledSeconds</code>无效的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/148\">#148</a></li>\n</ol>\n<h2 id='header-v0.7.4'>v0.7.4</h2><ol>\n<li><code>Add</code> <code>FormItem</code>支持单独使用，不用一定要嵌入<code>Form</code>组件下，以便可以复用它的样式 <a href=\"https://github.com/ksc-fe/kpc/issues/145\">#145</a></li>\n<li><code>Add</code> <code>Menu</code>渲染时自动展开已选择的菜单项 <a href=\"https://github.com/ksc-fe/kpc/issues/144\">#144</a></li>\n<li><code>Add</code> <code>Select</code>支持无边框的内联样式 <a href=\"https://github.com/ksc-fe/kpc/issues/146\">#146</a></li>\n<li><code>Add</code> <code>Tabs</code>标签页支持关闭功能</li>\n<li><code>Add</code> <code>Tabs</code>当标签页过多时自动展示翻页按钮 <a href=\"https://github.com/ksc-fe/kpc/issues/142\">#142</a></li>\n<li><code>Add</code> <code>Tree</code>支持节点过滤功能 <a href=\"https://github.com/ksc-fe/kpc/issues/137\">#137</a></li>\n</ol>\n<h2 id='header-v0.7.1'>v0.7.1</h2><ol>\n<li><code>Add</code> <code>Dropdown</code>及所有包含弹出菜单元素的组件支持<code>container</code>属性，以便自定义弹出菜单插入的位置 <a href=\"https://github.com/ksc-fe/kpc/issues/138\">#138</a></li>\n<li><code>Add</code> <code>Dialog</code>和<code>Drawer</code>弹层中的<code>Dropdown</code>，默认append到<code>k-dialog</code>元素下 <a href=\"https://github.com/ksc-fe/kpc/issues/138\">#138</a><blockquote>\n<p>vue需要升级<code>intact-vue</code>到<code>v0.4.0</code>才能完美支持该功能，否则会出现部分情况下依然append到<code>body</code>的情况</p>\n</blockquote>\n</li>\n<li><code>Add</code> <code>Menu</code>支持<code>dot</code>属性，以便往菜单项前面添加圆点 <a href=\"https://github.com/ksc-fe/kpc/issues/143\">#143</a></li>\n<li><code>Add</code> <code>Menu</code>支持<code>block</code>扩展点，以便自定义菜单头部 <a href=\"https://github.com/ksc-fe/kpc/issues/143\">#143</a></li>\n<li><code>Change</code> <code>Menu</code>菜单样式调整 <a href=\"https://github.com/ksc-fe/kpc/issues/135\">#135</a></li>\n<li><code>Fix</code> 修复<code>Dropdown</code>右键菜单模式在Vue下报错的问题，该bug不会影响功能 <a href=\"https://github.com/ksc-fe/kpc/issues/141\">#141</a></li>\n<li><code>Fix</code> 修复将<code>Event</code>作为属性类型检测，但是在NodeJs下不存在该构造函数导致的报错问题</li>\n</ol>\n<h2 id='header-v0.7.0'>v0.7.0</h2><blockquote>\n<p><code>@since v0.7.0</code>版本需要<code><a href=\"mailto:intact@2.4.1\">intact@2.4.1</a></code><code><a href=\"mailto:intact-vue@0.3.9\">intact-vue@0.3.9</a></code>支持</p>\n</blockquote>\n<ol>\n<li><code>Add</code> <code>Table</code>支持<code>loading</code>状态 <a href=\"https://github.com/ksc-fe/kpc/issues/128\">#128</a></li>\n<li><code>Add</code> <code>Spin</code>支持遮罩层动画<code>overlay</code> <a href=\"https://github.com/ksc-fe/kpc/issues/139\">#139</a></li>\n<li><code>Add</code> <code>Form</code>新增<code>labelWidth</code>属性，用于定义所有<code>FormItem</code>的<code>label</code>宽度 <a href=\"https://github.com/ksc-fe/kpc/issues/127\">#127</a></li>\n<li><code>Fix</code> 修复<code>Tree</code> <code>class</code>和<code>style</code>属性丢失的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/136\">#136</a> </li>\n<li><code>Fix</code> 修复<code>Dropdown</code>的<code>of</code>属性在Vue下传入事件对象会报属性类型不匹配的问题</li>\n<li><code>Fix</code> 修复<code>Timepicker</code>隐藏弹层会<code>focus</code>输入框导致页面滚动的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/126\">#126</a></li>\n<li><code>Fix</code> 修复<code>Drawer</code>在Vue下，点击触发按钮弹出弹层，弹层又会立即消失的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/140\">#140</a></li>\n<li><code>Fix</code> 修复<code>Drawer</code>默认主题动画不协调的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/134\">#134</a></li>\n</ol>\n<h2 id='header-v0.6.1'>v0.6.1</h2><ol>\n<li><code>Fix</code> 修复<code>v0.6.0</code>引入的<code>@css</code>编译版字体文件丢失的问题</li>\n<li><code>Fix</code> 修复当<code>Dialog</code>的<code>footer</code>只存在一个<code>Button</code>时，样式展示问题 <a href=\"https://github.com/ksc-fe/kpc/issues/132\">#132</a></li>\n<li><code>Fix</code> 修复<code>Tooltip</code>没有加载<code>Dropdown</code>样式的问题，这个问题当只使用<code>Tooltip</code>而不使用<code>Dropdown</code>组件时复现 <a href=\"https://github.com/ksc-fe/kpc/issues/133\">#133</a></li>\n</ol>\n<h2 id='header-v0.6.0'>v0.6.0</h2><ol>\n<li><code>Add</code> 新增<code>Drawer</code>抽屉组件 <a href=\"https://github.com/ksc-fe/kpc/issues/112\">#112</a></li>\n<li><p><code>Change</code> 调整字体加载路径，兼容parcel <a href=\"https://github.com/ksc-fe/kpc/issues/131\">#131</a></p>\n<p> webpack.config.js配置文件需要更改如下所示：</p>\n<pre><code class=\"hljs js\"> {\n     <span class=\"hljs-symbol\">test:</span> /\\.styl<span class=\"hljs-variable\">$/</span>,\n     <span class=\"hljs-symbol\">loader:</span> <span class=\"hljs-string\">'stylus-loader'</span>, \n     <span class=\"hljs-symbol\">options:</span> {\n         <span class=\"hljs-string\">'include css'</span>: <span class=\"hljs-keyword\">true</span>,\n         <span class=\"hljs-string\">'resolve url'</span>: <span class=\"hljs-keyword\">true</span>,\n         <span class=\"hljs-symbol\">sourceMap:</span> <span class=\"hljs-keyword\">false</span>,\n         <span class=\"hljs-regexp\">//</span> <span class=\"hljs-string\">'import'</span>: <span class=\"hljs-string\">'~kpc/styles/themes/ksyun/index.styl'</span>,\n     }\n }\n</code></pre>\n</li>\n<li><code>Change</code> 调整package.json <code>module</code>字段指向 <a href=\"https://github.com/ksc-fe/kpc/issues/130\">#130</a></li>\n<li><code>Fix</code> 修复<code>Datepicker</code>disableSeconds等参数禁用无效 <a href=\"https://github.com/ksc-fe/kpc/issues/124\">#124</a></li>\n<li><code>Fix</code> 修复<code>App</code>loading动画没有在最上层的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/120\">#120</a></li>\n<li><code>Fix</code> convert Number to String to validate length <a href=\"https://github.com/ksc-fe/kpc/issues/125\">#125</a></li>\n<li><code>Fix</code> 修复<code>Datepicker</code>can not set width with style <a href=\"https://github.com/ksc-fe/kpc/issues/122\">#122</a></li>\n<li><code>Fix</code> 修复<code>Timepicker</code>step状态下class和style不能自定义 <a href=\"https://github.com/ksc-fe/kpc/issues/121\">#121</a></li>\n</ol>\n<h2 id='header-v0.5.15'>v0.5.15</h2><ol>\n<li><code>Fix</code> <code>Button</code>样式声明中<code>success</code>类型变量丢失的问题</li>\n<li><code>Fix</code> <code>Transfer</code>当<code>data</code>数据变更时，不能更新全选状态的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/109\">#109</a></li>\n<li><code>Fix</code> <code>Cascader</code>当级联菜单碰撞反转，3级以下菜单存在错误的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/111\">#111</a></li>\n<li><code>Fix</code> <code>App</code>加载动画会被挡住的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/120\">#120</a></li>\n<li><code>Fix</code> <code>Timepicker</code>传入初始时间字符串会当做数组处理的问题</li>\n<li><code>Add</code> <code>Tree</code>新增左击(<code>click:node</code>)和右击(<code>rightclick:node</code>)节点事件 <a href=\"https://github.com/ksc-fe/kpc/issues/117\">#117</a></li>\n<li><code>Add</code> <code>Dropdown</code>支持右键菜单 <a href=\"https://github.com/ksc-fe/kpc/issues/118\">#118</a></li>\n<li><code>Add</code> <code>Transfer</code>优化<code>shift</code>多选逻辑</li>\n<li><code>Add</code> <code>package.json</code>中添加<code>sideEffects</code>字段，以便支持webpack <code>tree-shaking</code> </li>\n</ol>\n<h2 id='header-v0.5.14'>v0.5.14</h2><ol>\n<li><code>Fix</code> <code>Tree</code>删除节点没有更新选中状态 <a href=\"https://github.com/ksc-fe/kpc/issues/102\">#102</a></li>\n<li><code>Fix</code> <code>Cascader</code>支持<code>data</code>属性一开始就传入<code>undefined</code>，以便数据完全动态加载 <a href=\"https://github.com/ksc-fe/kpc/issues/103\">#103</a></li>\n<li><code>Fix</code> <code>Grid</code>响应式取值不能重置为<code>0</code> <a href=\"https://github.com/ksc-fe/kpc/issues/104\">#104</a></li>\n<li><code>Fix</code> <code>Datepicker</code>范围选择成功后，再次取消已选值，重新选择会出现<code>null</code> <a href=\"https://github.com/ksc-fe/kpc/issues/105\">#105</a></li>\n<li><code>Fix</code> <code>Editable</code>没有传入<code>value</code>，不能展示子元素的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/106\">#106</a></li>\n<li><code>Fix</code> <code>package.json</code> <code>browser</code>字段指向错误的问题</li>\n</ol>\n<h2 id='header-v0.5.13'>v0.5.13</h2><ol>\n<li><code>Fix</code> 修复<code>Steps</code>在宽度不够的情况下，索引不展示；以及在<code>vue</code>下<code>Step</code>宽度不等分的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/100\">#100</a></li>\n<li><code>Fix</code> 修复<code>Table</code>在Firefox下，<code>word-break: break-all</code>不支持的问题</li>\n<li><code>Fix</code> 修复<code>Tooltip</code>在应该隐藏箭头的情况下，没有隐藏的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/101\">#101</a></li>\n</ol>\n<h2 id='header-v0.5.12'>v0.5.12</h2><ol>\n<li><code>Add</code> 新增<code>Menu</code>菜单组件 <a href=\"https://github.com/ksc-fe/kpc/issues/90\">#90</a></li>\n<li><code>Fix</code> 修复Fixfox下，<code>Spin</code>不能展示的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/97\">#97</a></li>\n<li><code>Fix</code> 修复Fixfox下，<code>Table</code>在固定右侧列并出现纵向滚动条的情况下，左侧单元格宽度不正确导致出现空白间隙的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/98\">#98</a></li>\n<li><code>Fix</code> 修复<code>Timeline</code>文字与图标没对齐的问题</li>\n<li><code>Fix</code> 修复<code>Collapse</code>手风琴模式下，无法全部收起的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/99\">#99</a></li>\n</ol>\n<h2 id='header-v0.5.11'>v0.5.11</h2><blockquote>\n<p>要使用<code>Table</code>新特性，需要更新<code>Intact</code>至<code>v2.3.5</code>及以上</p>\n</blockquote>\n<ol>\n<li><code>Add</code> <code>Table</code>支持列固定 <a href=\"https://github.com/ksc-fe/kpc/issues/86\">#86</a></li>\n<li><code>Add</code> <code>Table</code>支持横向滚动条吸底 <a href=\"https://github.com/ksc-fe/kpc/issues/96\">#96</a></li>\n<li><code>Fix</code> 修复<code>Table</code>固定表头横向滚动的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/89\">#89</a></li>\n</ol>\n<h2 id='header-v0.5.10'>v0.5.10</h2><ol>\n<li><code>Fix</code> 修复<code>Select</code>将<code>0</code>当做空值处理的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/94\">#94</a></li>\n<li><code>Fix</code> 修复<code>Transfer</code>不能取消全选的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/95\">#95</a></li>\n</ol>\n<h2 id='header-v0.5.9'>v0.5.9</h2><ol>\n<li><code>Add</code> 新增<code>xxl</code>响应式宽度<code>≥1600px</code></li>\n<li><code>Change</code> 改变全局字体行高<code>1.5</code></li>\n<li><code>Fix</code> Firefox下<code>Datepicker</code>快速切换年月按钮错位的问题</li>\n</ol>\n<h2 id='header-v0.5.7'>v0.5.7</h2><ol>\n<li><code>Add</code> <code>Grid</code>改进，支持响应式，以及<code>pull</code> <code>push</code> <code>order</code>等属性 <a href=\"https://github.com/ksc-fe/kpc/issues/87\">#87</a></li>\n<li><code>Add</code> 新增时间轴组件<code>Timeline</code> <a href=\"https://github.com/ksc-fe/kpc/issues/77\">#77</a></li>\n<li><code>Add</code> <code>Message</code>在Vue全局安装的情况下，支持<code>this.$message.success()</code>的调用方式 <a href=\"https://github.com/ksc-fe/kpc/issues/88\">#88</a></li>\n</ol>\n<h2 id='header-v0.5.6'>v0.5.6</h2><ol>\n<li><code>Add</code> 新增时间选择组件<code>Timepicker</code></li>\n<li><code>Add</code> 新增树形控件<code>Tree</code></li>\n<li><code>Add</code> <code>Datepicker</code>支持只选择年/月 <a href=\"https://github.com/ksc-fe/kpc/issues/84\">#84</a></li>\n<li><code>Add</code> <code>Datepicker</code>可选择范围，支持控制到秒的精度 <a href=\"https://github.com/ksc-fe/kpc/issues/81\">#81</a></li>\n<li><code>Add</code> <code>Table</code>组件支持表头吸顶功能 <a href=\"https://github.com/ksc-fe/kpc/issues/85\">#85</a></li>\n<li><code>Change</code> <code>Datepicker</code>交互变更，支持快速切换时间选择</li>\n<li><code>Change</code> <code>Checkbox</code>将<code>click</code> <code>mouseenter</code> <code>mouseleave</code>事件绑定在最外层元素上，而不是<code>input</code>上</li>\n<li><code>Fix</code> 修复<code>Cascader</code>无法获取完整取值的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/78\">#78</a></li>\n<li><code>Fix</code> 修复<code>Table</code> <code>expand</code>属性不兼容<a href=\"mailto:intact-vue@v0.3\">intact-vue@v0.3</a>的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/82\">#82</a></li>\n<li><code>Fix</code> 修复<code>Button</code> <code>showLoading</code>后<code>hideLoading</code>，在某些情况下子元素渲染出错的问题</li>\n</ol>\n<h2 id='header-v0.5.4'>v0.5.4</h2><ol>\n<li><code>Add</code> 新增<code>Spin</code>加载动画组件 <a href=\"https://github.com/ksc-fe/kpc/issues/74\">#74</a></li>\n<li><code>Add</code> <code>Form</code>新增<code>getFirstInvalidFormItem</code>方法，用于获取第一个出错的<code>FormItem</code> <a href=\"https://github.com/ksc-fe/kpc/issues/73\">#73</a></li>\n<li><code>Fix</code> <code>Datepicker</code>月份切换问题 <a href=\"https://github.com/ksc-fe/kpc/issues/62\">#62</a></li>\n<li><code>Fix</code> 修复<code>FormItem</code>错误信息某些情况下的样式问题 <a href=\"https://github.com/ksc-fe/kpc/issues/75\">#75</a> </li>\n<li><code>Refactor</code> 改变内置动画className命名，避免冲突 <a href=\"https://github.com/ksc-fe/kpc/issues/76\">#76</a></li>\n</ol>\n<h2 id='header-v0.5.3'>v0.5.3</h2><ol>\n<li><code>Add</code> <code>Tag</code>组件支持<code>size</code>属性 <a href=\"https://github.com/ksc-fe/kpc/issues/68\">#68</a></li>\n<li><code>Add</code> 新增<code>Tip</code>组件，用于展示警告提示信息 <a href=\"https://github.com/ksc-fe/kpc/issues/69\">#69</a></li>\n<li><code>Add</code> <code>Tabs</code>新增一种无边框的卡片样式，适用于具有背景的场景 <a href=\"https://github.com/ksc-fe/kpc/issues/70\">#70</a></li>\n<li><code>Add</code> <code>Steps</code>新增一种简洁样式<code>simple</code> <a href=\"https://github.com/ksc-fe/kpc/issues/71\">#71</a></li>\n<li><code>Add</code> <code>Steps</code>支持<code>clickable</code>属性，用于快速切换已完成的步骤 <a href=\"https://github.com/ksc-fe/kpc/issues/72\">#72</a></li>\n<li><code>Change</code> 部分组件样式调整 <a href=\"https://github.com/ksc-fe/kpc/issues/67\">#67</a></li>\n</ol>\n<h2 id='header-v0.5.0'>v0.5.0</h2><p><code>0.5.0</code>版本需要<code><a href=\"mailto:vdt@1.3.0\">vdt@1.3.0</a></code><code><a href=\"mailto:intact@2.3.0\">intact@2.3.0</a></code><code><a href=\"mailto:intact-vue@0.3.0\">intact-vue@0.3.0</a></code>支持</p>\n<ol>\n<li><code>Add</code> 支持组件属性类型检查</li>\n<li><code>Add</code> 支持带参数的<code>block</code></li>\n<li><code>Add</code> 支持通过<code>v-model</code>绑定任意属性值</li>\n<li><code>Add</code> 支持同一事件绑定多次回调函数</li>\n<li><code>Refactor</code> <code>App</code>组件重构，减少依赖 <a href=\"https://github.com/ksc-fe/kpc/issues/65\">#65</a></li>\n<li><code>Fix</code> 在<code>Vue</code>下<code>Vue.use(Kpc)</code>全量使用的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/63\">#63</a> <a href=\"https://github.com/ksc-fe/kpc/issues/64\">#64</a></li>\n</ol>\n<h2 id='header-v0.4.0'>v0.4.0</h2><ol>\n<li><code>Add</code> 新增级联选择组件<code>Cascader</code></li>\n<li><code>Add</code> 新增标签组件<code>Tag</code></li>\n<li><code>Add</code> 新增徽标组件<code>Badge</code></li>\n<li><code>Add</code> 新增折叠面板组件<code>Collapse</code></li>\n<li><code>Add</code> <code>Pagination</code>支持无边框样式，<a href=\"https://github.com/ksc-fe/kpc/issues/33\">#33</a></li>\n<li><code>Add</code> 嵌套<code>Dropdown</code>支持子菜单相对父菜单定位</li>\n<li><code>Change</code> 更新ksyun主题<code>Message</code>样式</li>\n<li><code>Change</code> 优化<code>Dropdown</code>键盘操作</li>\n<li><code>Change</code> 更新ksyun主题<code>Progress</code>样式</li>\n<li><code>Fix</code> 修复<code>Datepicker</code>在点击年份等区域导致input失焦，然后<code>FormItem</code>立即验证的问题，<a href=\"https://github.com/ksc-fe/kpc/issues/46\">#46</a></li>\n<li><code>Fix</code> 修复<code>Tooltip</code> <code>hover</code>触发方式下，有时不能消失的问题，<a href=\"https://github.com/ksc-fe/kpc/issues/52\">#52</a></li>\n<li><code>Fix</code> 修复<code>Pagination</code>当传入的<code>limit</code>不是可选项时，页码错误的问题， <a href=\"https://github.com/ksc-fe/kpc/issues/48\">#48</a></li>\n<li><code>Fix</code> 修复<code>Select</code>键盘选中某项然后搜索导致该项不存在，此时按回车会报错的问题，<a href=\"https://github.com/ksc-fe/kpc/issues/50\">#50</a></li>\n</ol>\n<h2 id='header-v0.3.12'>v0.3.12</h2><ol>\n<li><code>Add</code> <code>TableColumn</code>支持<code>title</code>扩展点，<a href=\"https://github.com/ksc-fe/kpc/issues/19\">#19</a></li>\n<li><code>Add</code> <code>Transfer</code>支持全选和清空操作，<a href=\"https://github.com/ksc-fe/kpc/issues/18\">#18</a></li>\n<li><code>Fix</code> 修复<code>Editable</code>在invalid的状态下，父组件更新也会触发<code>$changed:value</code>事件的问题，<a href=\"https://github.com/ksc-fe/kpc/issues/51\">#51</a></li>\n<li><code>Fix</code> 修复<code>FormItem</code>在<code>model</code>不存在时，依然会验证导致报错的问题，<a href=\"https://github.com/ksc-fe/kpc/issues/47\">#47</a></li>\n<li><code>Fix</code> 修复<code>value</code>不存在options中时的问题，<a href=\"https://github.com/ksc-fe/kpc/issues/41\">#41</a> <a href=\"https://github.com/ksc-fe/kpc/issues/40\">#40</a></li>\n<li><code>Fix</code> <code>FormItem</code>延迟100ms去验证，来规避某些弹出型组件在失焦瞬间，可能闪现<code>required</code>错误信息的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/4\">#4</a></li>\n<li><code>Fix</code> 修复<code>Dropdown</code>在vue下，子元素事件丢失的问题</li>\n<li><code>Fix</code> 修复<code>Tooltip</code>箭头位置问题，<a href=\"https://github.com/ksc-fe/kpc/issues/17\">#17</a></li>\n</ol>\n<h2 id='header-v0.2.0'>v0.2.0</h2><ol>\n<li><code>Add</code> 表单元素(<code>Select</code> <code>Datepicker</code>等)支持键盘操作 <a href=\"https://github.com/ksc-fe/kpc/issues/7\">#7</a></li>\n<li><code>Add</code> <code>FormItem</code>支持强制验证 <a href=\"https://github.com/ksc-fe/kpc/issues/6\">#6</a></li>\n<li><code>Add</code> <code>Select</code>支持输入不存在的条目，此时它将作为最终值 <a href=\"https://github.com/ksc-fe/kpc/issues/5\">#5</a></li>\n<li><code>Fix</code> 修复<code>Table</code>在MacOS下<code>Checkbox</code>选不中的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/8\">#8</a></li>\n<li><code>Fix</code> 修复<code>Slider</code>中的<code>Input</code>不能输入中间过程值的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/9\">#9</a></li>\n<li><code>Fix</code> 修复<code>Form</code>表单验证<code>Select</code>选择时，闪现<code>required</code>错误信息的问题 <a href=\"https://github.com/ksc-fe/kpc/issues/4\">#4</a></li>\n</ol>\n<h2 id='header-v0.1.0'>v0.1.0</h2><ol>\n<li><code>Add</code> Datepicker支持日期范围选择, <a href=\"https://github.com/ksc-fe/kpc/issues/1\">#1</a></li>\n<li><code>Add</code> Datepicker选择日期和时间时，支持多选</li>\n<li><code>Add</code> 弹出菜单支持边界碰撞反转弹出弹出方向，<a href=\"https://github.com/ksc-fe/kpc/issues/2\">#2</a></li>\n<li><code>Fix</code> Vue中Tab不能切换的问题，<a href=\"https://github.com/ksc-fe/kpc/issues/3\">#3</a></li>\n<li><code>Fix</code> Slider在设置了步长后，拖动会闪动的问题</li>\n</ol>\n","index":258}

