module.exports = {"setting":{"title":"颜色","order":1,"sidebar":"design"},"catalogs":[],"contents":"<p>颜色作为一种感知性的设计语言，在表达设计目标时起到强化作用。因此在定义一系列色值的同时，更重要的是对他们在实际页面和情景中的使用方法进行标准化定义。通过颜色可实现如下功能：</p>\n<p><strong>体现内容类型与层级关系</strong></p>\n<p>标题、正文、帮助内容</p>\n<p><strong>强化行动召唤</strong></p>\n<p>主按钮、次按钮、链接</p>\n<p><strong>引起关注</strong></p>\n<p>红色的错误提示，绿色的成功提示，橙色的警告提示。</p>\n<p><strong>区隔内容</strong></p>\n<p>背景色，前景色</p>\n<h2 id='header-%E5%93%81%E7%89%8C%E8%89%B2'>品牌色</h2><p>品牌色贯穿整体设计的主要颜色风格。品牌色主要体现在关键行动点及操作状态、重要信息高亮等场景。</p>\n<!-- example --><p><img src=\"/imgs/design/pinpaise.jpg\" alt=\"品牌色\"></p>\n<p><strong>主色：</strong></p>\n<p>主色为产品中应用最频繁，且能代表品牌基调的颜色。</p>\n<p>在确定主色的同时选择主色的深色和浅色变体用于创造界面元素的对比。如，按钮、模块标题、交互状态等。</p>\n<p><strong>辅助色：</strong></p>\n<p>用于强调界面中的特殊元素。辅助色应慎重使用，仅作为强调和突出。</p>\n<p>辅助色也可以选择深色和浅色变体用于界面元素对比。如滑块与滑动条、按钮交互状态等。</p>\n<p><strong>文本和图标色：</strong></p>\n<p>当文本与图标应用于主色和辅助色之上时，应使文本和图标颜色明显区别于颜色背景，保证内容清晰可辨。</p>\n","index":54}

