module.exports = {"setting":{"title":"对话框","order":2,"category":"组件","sidebar":"design","disabled":true},"catalogs":[],"contents":"<h3 id='header-%E6%97%A0%E6%A0%87%E9%A2%98%E5%AF%B9%E8%AF%9D%E6%A1%86'>无标题对话框</h3><p>适用于操作确认场景，且当前页面只存在一个对话框时使用。</p>\n<p><img src=\"/imgs/design/wubiaotiduihuakuang.png\" alt=\"wubiaotiduihuakuang\"></p>\n<h3 id='header-%E5%B8%A6%E6%A0%87%E9%A2%98%E5%AF%B9%E8%AF%9D%E6%A1%86'>带标题对话框</h3><p>当同一页面中存在多个对话框时使用，标题可以提示用户当前操作所属，另通过详细说明，指明操作相关事项。</p>\n<p><img src=\"/imgs/design/biaotiduihuakuang.png\" alt=\"biaotiduihuakuang\"></p>\n<h3 id='header-%E5%A4%8D%E6%9D%82%E6%93%8D%E4%BD%9C%E5%AF%B9%E8%AF%9D%E6%A1%86'>复杂操作对话框</h3><p>对话框内包含表单内容时使用。提交表单时提交按钮需显示loading状态，并禁用提交按钮，确保无法反复提交。待提交成功后隐藏对话框。</p>\n<p><img src=\"/imgs/design/fuzaduihuakuang.png\" alt=\"fuzaduihuakuang\"></p>\n<h3 id='header-%E9%95%BF%E5%86%85%E5%AE%B9%E5%AF%B9%E8%AF%9D%E6%A1%86'>长内容对话框</h3><p>当弹窗内容超过500px时，使用长内容弹窗。长内容弹窗由浏览器右侧弹出，靠浏览器右侧显示，高度为窗口高度。</p>\n<p><img src=\"/imgs/design/changduihuakuang.png\" alt=\"changduihuakuang\"></p>\n","index":128}

