module.exports = {"setting":{"title":"格式","order":3,"sidebar":"design","disabled":true},"catalogs":[],"contents":"<h2 id='header-%E8%B4%B9%E7%94%A8%E9%87%91%E9%A2%9D'>费用金额</h2><p>金额费用一律精确到小数点后2位。</p>\n<p>书写费用金额时如果使用货币符号（¥），就不在金额后面写“元” 。</p>\n<p>如果需要在金额后面写元，就不能使用货币符号（¥），同时，数字与“元”字间加半角空格。</p>\n<h2 id='header-%E6%97%A5%E6%9C%9F'>日期</h2><p>日期书写格式为：年-月-日。其中日期数字使用阿拉伯数字。</p>\n<p>完整格式：2018年5月29日，带单位，完整格式通常使用在段落文本中。</p>\n<p>缩写：2018-05-29，缩写日期时如年、月不足2位，则用0补位，以保证对齐时格式统一。缩写格式不带单位，年、月、日用斜杠隔开。</p>\n<p>日期范围：2018-05-01 ~ 2018-05-30。表示日期范围时，日期中间用“~”隔开，同时“~”两侧加空格。</p>\n<h2 id='header-%E6%97%B6%E9%97%B4'>时间</h2><p>时间使用24小时制。其中时间数字使用阿拉伯数字。</p>\n<p>完整格式：15点30分0秒。完整格式通常使用在段落文本中。</p>\n<p>缩写：15:30:00。缩写格式，单位不足2位时用0补位，保证对齐时格式统一。</p>\n<p>时间范围：15:30:00 ~ 18:05:00。表示时间范围时，时间点中间用“~”隔开，同时“~”两侧加空格。</p>\n<p>带日期的时间：2018-05-01 15:30:00。日期与时间中间用空格隔开。</p>\n","index":152}

