module.exports = {"setting":{"title":"提示","order":3,"category":"组件","sidebar":"design","disabled":true},"catalogs":[],"contents":"<h3 id='header-%E8%AD%A6%E5%91%8A%E6%8F%90%E7%A4%BA'>警告提示</h3><p>提示信息常驻与页面中，不能关闭，不会自动消失。</p>\n<p><strong>操作警告</strong></p>\n<p>单段文本，进行重要操作提示，或操作会造成负面影响时使用。</p>\n<p><img src=\"/imgs/design/caozuojinggao.png\" alt=\"caozuojinggao\"></p>\n<p><strong>公告提示</strong></p>\n<p>单段文本，提示内容不影响用户，或不造成重大影响时使用。</p>\n<p><img src=\"/imgs/design/gonggaotishi.png\" alt=\"gonggaotishi\"></p>\n<p><strong>帮助说明</strong></p>\n<p>多段说明性内容，可以添加文字链接。</p>\n<p><img src=\"/imgs/design/bangzhushuoming.png\" alt=\"bangzhushuoming\"></p>\n<h3 id='header-%E5%85%A8%E5%B1%80%E6%8F%90%E7%A4%BA'>全局提示</h3><p>匀速移动并逐渐显示与页面最高层级，吸引用户注意。用于页面级操作的反馈。可以点击关闭，如不关闭会在出现后5秒后自动消失。</p>\n<p><img src=\"/imgs/design/quanjutishi.png\" alt=\"quanjutishi\"></p>\n<h3 id='header-%E5%B8%AE%E5%8A%A9%E6%B0%94%E6%B3%A1'>帮助气泡</h3><p>在目标获取焦点时，显示相关帮助提示，对当前内容进行说明，帮助用户完成当前操作。帮助提示不应遮挡操作内容。失去焦点后会自动消失。</p>\n<p><img src=\"/imgs/design/bangzhuqipao.png\" alt=\"bangzhuqipao\"></p>\n<h3 id='header-%E6%96%87%E5%AD%97%E6%8F%90%E7%A4%BA'>文字提示</h3><p>单行文字提示，内容不得超过20个中文字符。替换默认title提示，不遮挡内容主体，当有其他弹出内容提示时，不使用文字提示。</p>\n<p><img src=\"/imgs/design/wenzitishi.png\" alt=\"wenzitishi\"></p>\n","index":161}

